currently if you do 
import angular = require("angular"); 
tsc will throw 2071 - Unable to resolve external module 'angular'
this 
declare module 'angular'{
    export var angular:ng.IAngularStatic;
}
declares such a module.

rewrite with "Ghostin' modules" coding style.
note that

```
export = dcodeIO.Long;
```

was not compiled. so I used

```
declare module "long" {
    var Long:dcodeIO.LongStatic;
    export = Long;
}
```
